import React from "react";

function LoginForm() {
  return (
    <div>
      <h1>Login</h1>
      <form>
        <input>
          <i class="fa-solid fa-user" style="color: #ffffff;"></i>
        </input>
        <input>
          <i class="fa-solid fa-lock" style="color: #ffffff;"></i>
        </input>
      </form>
    </div>
  );
}

export default LoginForm;
